class Tree {
    units = {};

    constructor() {
        this.defaultTree();
    }

    defaultTree() {
        var archer = ["Archer", "Crossbowman", "Arbalester"];
        var skirm = ["Skirmisher", "Elite Skirmisher"];
        var ca = ["Cavalry Archer", "Heavy Cavalry Archer"];
        var hc = ["Hand Cannoneer"];

        this.units.archer = archer;
        this.units.skirm = skirm;
        this.units.ca = ca;
        this.units.hc = hc;
        console.log(this.units);
    }
}

export default Tree;
